import sys

def main():
    h, w, k = map(int, sys.stdin.readline().split())
    grid = []
    for i in range(h):
        grid.append(sys.stdin.readline().strip())
    count = 0
    for i in range(1 << h):
        for j in range(1 << w):
            cnt = 0
            for r in range(h):
                for c in range(w):
                    if (i >> r) & 1 == 1:
                        cnt += 1
                    elif (j >> c) & 1 == 1:
                        cnt += 1
                    elif grid[r][c] == '#':
                        cnt += 1
            if cnt == k:
                count += 1
    print(count)

if __name__ == '__main__':
    main()
